B.Ib=new A.vI("Declara\xe7\xe3o FATCA",' A Receita Federal Brasileira, atrav\xe9s da\nInstru\xe7\xe3o Normativa RFB\nn\xba 1.571/2015, estabeleceu uma s\xe9rie\nde procedimentos em rela\xe7\xe3o \xe0s\nopera\xe7\xf5es financeiras. \nUm dos itens\nprevistos nessa Instru\xe7\xe3o trata da\ncomunica\xe7\xe3o realizada com o governo\ndos E.U.A, por meio do FATCA. O FATCA\n- "Foreign Account Tax Compliance\nAct" \xe9 uma lei norte-americana que\nvisa combater a evas\xe3o fiscal em\nrela\xe7\xe3o aos rendimentos e outros\nganhos de investimentos feitos fora dos E.U.A por cidad\xe3os norte-americanos e cidad\xe3o estrangeiros com obriga\xe7\xf5es fiscais nos E.U.A, designados como US Person. \nO governo brasileiro assinou acordo para a troca de informa\xe7\xf5es com a Receita Federal Americana e as institui\xe7\xf5es financeiras e entidades fechadas de previd\xeancia complementar devem identificar as US Person em sua base de participantes. \nPara efeitos do FATCA, ser\xe3o considerados US Person os participantes que possuam, peo menos uma das seguintes caracter\xedsticas:\nNascidos nos Estados Unidos da Am\xe9rica (E.U.A);\nCidadania norte-americana,\nincluindo os detentores de dupla\nnacionalidade e passaporte norte-\namericano, ainda que residam fora\ndos Estados Unidos da Am\xe9rica (E.U.A);\nResid\xeancia permanente nos Estados\nUnidos da Am\xe9rica (E.U.A) ou presen\xe7a\nsubstancial (ficou pelo menos 31 dias\nno ano corrente e 183 dias nos\n\xfaltimos 3 anos);\nEndere\xe7o de caixa postal nos\nEstados Unidos da Am\xe9rica (E.U.A);\nDetentores do Green Card;\nTenha empresa constitu\xedda sob \xe0s\nleis dos E.U.A (Domestic Partnership ou\nsociedade dom\xe9stica), conforme\ndefinido na Instru\xe7\xe3o Normativa\n1.571/2015, que disp\xf5e da\nnecessidade de identifica\xe7\xe3o de\nparticipantes que seja "Pessoa dos\nE.U.A - US Person", em atendimento ao\nFATCA - Acordo entre os E.U.A e o\nBrasil, Decreto 8506 de 24/08/2015;\n Participa\xe7\xe3o societ\xe1ria (mais de\n10%) em alguma empresa nos\nEstados Unidos da Am\xe9rica (E.U.A);\nTenha conta em institui\xe7\xe3o financeira ou alguma fonte de renda\nnos Estados Unidos da Am\xe9rica (E.U.A);\n \xc9 benefici\xe1rio final em seus\ninvestimentos e opera\xe7\xf5es nos\nEstados Unidos da Am\xe9rica (E.U.A);\n E outras caracter\xedsticas que possam\nser publicadas pela Receita Federal do\nBrasil.\n\nIMPORTANTE:\nTodos os participantes devem\npreencher a op\xe7\xe3o abaixo\nenquadrando-se ou n\xe3o em algum dos\nperfis descritos acima e dever\xe3o\nrepassar suas informa\xe7\xf5es para a\nFunda\xe7\xe3o atender essa normativa.\nO envio das informa\xe7\xf5es \xe9 de car\xe1ter\nobrigat\xf3rio e a Funda\xe7\xe3o solicita sua\ncolabora\xe7\xe3o para manter o seu\ncadastro atualizado.\n\nOP\xc7\xc3O DO PARTICIPANTE:\nCaso voc\xea N\xc3O SE ENQUADRE em\nnenhuma das condi\xe7\xf5es descritas\nacima, por gentileza, assinalar a\nop\xe7\xe3o:\n=> Declaro para os devidos fins de direito sob as penas da lei, que "N\xc3O\nSOU" Us Person, ou seja, n\xe3o me\nenquadro no acordo FATCA.\nCaso voc\xea SE ENQUADRE em algumas\ndas condi\xe7\xf5es descritas acima, por\ngentileza, assinalar a op\xe7\xe3o:\n=> Declaro para os devidos fins de\ndireito sob as penas da lei, que "SOU"\nUs Person, ou seja, me enquadro no\nacordo FATCA.\n\nComprometo a informar \xe0 Funda\xe7\xe3o,\nem at\xe9 10 dias, qualquer altera\xe7\xe3o nas\ninforma\xe7\xf5es prestadas neste\nformul\xe1rio FATCA.',4,"fatca")
